import React from 'react'

export default function pageButton({ type, page, changePage }) {
    return (
        <div>
            <button class={`btn-inline results__btn--${type}`} onClick={() => changePage(type === "prev" ? page - 1 : page + 1)} />
            <span>Page {type === "prev" ? page - 1 : page + 1}</span>            
            <svg class="search__icon">
                <use href={`../../img/icons.svg#icon-triangle-${type === "prev" ? "left" : "right"}`} />
            </svg>
        </div>
    )
}
